import React, { Component } from 'react';
import { Table, Button , Header , Container } from 'semantic-ui-react';
import { Link } from 'react-router-dom';
import {products} from '../products';
export default class ProductList extends Component {
    constructor(props){
        super(props);
        this.state = {
            productList : []
        }
    }
    componentWillMount(){
        this.setState({productList: products})

    }
    render() {
        return (
            <div>
                <React.Fragment>
                    <Container>
                        <Header size='large'>Mobile Products</Header>
                        <Table celled>
                            <Table.Header>
                            <Table.Row>
                                <Table.HeaderCell>Name</Table.HeaderCell>
                                <Table.HeaderCell>Weight</Table.HeaderCell>
                                <Table.HeaderCell>Availability</Table.HeaderCell>
                                <Table.HeaderCell>isEditable</Table.HeaderCell>
                            </Table.Row>
                            </Table.Header>

                            <Table.Body>
                            <Table.Row>
                                <Table.Cell>Cell</Table.Cell>
                                <Table.Cell>Cell</Table.Cell>
                                <Table.Cell>Cell</Table.Cell>
                                <Table.Cell><Link to="/editproduct"><Button primary>isEditable</Button></Link></Table.Cell>
                            </Table.Row>
                            <Table.Row>
                                <Table.Cell>Cell</Table.Cell>
                                <Table.Cell>Cell</Table.Cell>
                                <Table.Cell>Cell</Table.Cell>
                                <Table.Cell><Button primary>isEditable</Button></Table.Cell>
                            </Table.Row>
                            <Table.Row>
                                <Table.Cell>Cell</Table.Cell>
                                <Table.Cell>Cell</Table.Cell>
                                <Table.Cell>Cell</Table.Cell>
                                <Table.Cell><Button primary>isEditable</Button></Table.Cell>
                            </Table.Row>
                            </Table.Body>
                        </Table>
                    </Container>

                </React.Fragment>
            </div>
        )
    }
}
